const ImageGridListStyle = {
	root: {
	    display: 'flex',
	    flexWrap: 'wrap',
	    justifyContent: 'space-around',
	    overflow: 'hidden',
	},
	gridList: {
		padding: "20px",
		'&::after': {
			margin: "200px"
		}
	},
};

export default ImageGridListStyle;
